import React from 'react'
import  { Box } from '@mui/material'
import { Dropdown } from './Dropdown';


const genes = [
    'BRCA1', 
    'BRCA2',
    'GEMS', 
    'XYZ'
]

export const Graph = () => {

    return (
        <Box>
            <Dropdown data={genes} />
        </Box>
    )

}
